import React from "react";

import styles from "./NavigationItems.module.css";
import NavigationItem from "./NavigationItem/NavigationItem";

const navigationItems = (props: any) => {
  function jsUcfirst(string: string) {
    return string.charAt(0).toUpperCase() + string.slice(1);
  }

  const navList = ["about", "work", "projects", "contact"];
  const nav = navList.map((navItem) => {
    if (navItem == props.currentSection)
      return <NavigationItem link={navItem}>{navItem}</NavigationItem>;

    return <NavigationItem link={navItem}>{navItem}</NavigationItem>;
  });
  return (
    <ul className={styles.NavigationItems}>
      <NavigationItem link="about" exact>
        About
      </NavigationItem>
      <NavigationItem link="work">Work</NavigationItem>
      {/* <NavigationItem link="experience">Experience</NavigationItem> */}
      <NavigationItem link="projects">Projects</NavigationItem>
      <NavigationItem link="contact">Contact</NavigationItem>
    </ul>
  );
};

export default navigationItems;
